description:
Stripped (Ava Rose / Andre Madness, Adam &amp; Eve / 2007)

Sarah (Ava Rose) is a struggling actress in Hollywood. She goes from one audition to another before she finally lands the role she was born to play: stripper! But Sarah's acting skills pay off in ways she never dreamed as she struts, strips and seduces her audience (and the other dancers!) becoming whatever fantasy they desire!

Ava Rose, Brooke Banner, Kelli Tyler, Kelly Kline, Brad Hardy, Kris Knight, Richard Kline, Seth Dickens, Steven St. Croix

Feature, Couples, Creampie

